        >
          <MORE onClose={closeMORE} />
        </PortalPopup>
      )}
      {isLoginOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeLogin}
        >
          <Login onClose={closeLogin} />
        </PortalPopup>
      )}
      {isCITYOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeCITY}
        >
          <CITY onClose={closeCITY} />
        </PortalPopup>
      )}
    </>
  );
};

export default Homepage;
